import React from 'react'
import { Chart } from 'react-google-charts'

class GooglePieChart extends React.Component{
    render(){
        return(
        <>
            <Chart
          chartType="PieChart"
          loader={<div>Loading Chart</div>}
          data={this.props.pieData}
          options={{
            title: 'Chart',
          }}
        />
        </>
        )
    }
}

export default GooglePieChart
